import React, { useEffect } from "react";
import { apiGet } from "../services/requestService";

export function GameMenu(): JSX.Element {
    useEffect(
        () =>{
            apiGet().then(x=>console.log(x.data))
        }
        , []
    );
  return (
    <div>
      <a href="/registry">
        <button type="button">Sign Up</button>
      </a>
      <a href="/savedG">
        <button type="button">Sign Up</button>
      </a>
    </div>
  );
}
